import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  Divider,
  Paper,
  Tooltip,
  Fab,
} from '@mui/material';
import {
  Close as CloseIcon,
  Save as SaveIcon,
  Delete as DeleteIcon,
  Edit as EditIcon,
  NoteAdd as NoteAddIcon,
  MenuBook as NotebookIcon,
} from '@mui/icons-material';
import { styled } from '@mui/material/styles';

const StyledDrawer = styled(Drawer)(({ theme }) => ({
  '& .MuiDrawer-paper': {
    width: '400px',
    maxWidth: '90vw',
    backgroundColor: theme.palette.background.default,
    borderLeft: `1px solid ${theme.palette.divider}`,
  },
}));

const NotebookHeader = styled(Box)(({ theme }) => ({
  padding: theme.spacing(2),
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  borderBottom: `1px solid ${theme.palette.divider}`,
  backgroundColor: theme.palette.background.paper,
}));

const NotebookContent = styled(Box)(({ theme }) => ({
  height: 'calc(100vh - 64px)', // Adjust based on header height
  overflow: 'auto',
  padding: theme.spacing(2),
}));

const NotebookEntry = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(2),
  marginBottom: theme.spacing(2),
  backgroundColor: theme.palette.background.paper,
  '&:hover': {
    boxShadow: theme.shadows[4],
  },
}));

const FloatingButton = styled(Fab)(({ theme }) => ({
  position: 'fixed',
  right: theme.spacing(3),
  bottom: theme.spacing(3),
  zIndex: theme.zIndex.drawer - 1,
}));

const EmptyState = styled(Box)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  height: '100%',
  padding: theme.spacing(3),
  color: theme.palette.text.secondary,
  '& svg': {
    fontSize: 48,
    marginBottom: theme.spacing(2),
    opacity: 0.5,
  },
}));

function Notebook() {
  const [isOpen, setIsOpen] = useState(false);
  const [entries, setEntries] = useState(() => {
    const saved = localStorage.getItem('notebook-entries');
    return saved ? JSON.parse(saved) : [];
  });
  const [editMode, setEditMode] = useState(false);
  const [selectedEntry, setSelectedEntry] = useState(null);

  useEffect(() => {
    localStorage.setItem('notebook-entries', JSON.stringify(entries));
  }, [entries]);

  useEffect(() => {
    const handleAddToNotebook = (event) => {
      const { detail } = event;
      if (detail) {
        setEntries(prev => [...prev, {
          id: Date.now(),
          ...detail,
          timestamp: new Date().toISOString()
        }]);
        setIsOpen(true); // Open drawer when new entry is added
      }
    };

    window.addEventListener('addToNotebook', handleAddToNotebook);
    return () => window.removeEventListener('addToNotebook', handleAddToNotebook);
  }, []);

  const handleDelete = (entryId) => {
    setEntries(prev => prev.filter(entry => entry.id !== entryId));
  };

  const handleEdit = (entry) => {
    setSelectedEntry(entry);
    setEditMode(true);
  };

  return (
    <>
      <FloatingButton
        color="primary"
        onClick={() => setIsOpen(true)}
        aria-label="open notebook"
      >
        <NotebookIcon />
      </FloatingButton>

      <StyledDrawer
        anchor="right"
        open={isOpen}
        onClose={() => setIsOpen(false)}
      >
        <NotebookHeader>
          <Typography variant="h6">My Notebook</Typography>
          <IconButton onClick={() => setIsOpen(false)}>
            <CloseIcon />
          </IconButton>
        </NotebookHeader>

        <NotebookContent>
          {entries.length === 0 ? (
            <EmptyState>
              <NoteAddIcon />
              <Typography variant="body1">
                Your notebook is empty. Drag and drop messages here or use the "Add to Notebook" option in message menus.
              </Typography>
            </EmptyState>
          ) : (
            entries.map((entry) => (
              <NotebookEntry key={entry.id} elevation={1}>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
                  <Typography variant="caption" color="textSecondary">
                    {new Date(entry.timestamp).toLocaleString()}
                  </Typography>
                  <Box>
                    <Tooltip title="Edit">
                      <IconButton size="small" onClick={() => handleEdit(entry)}>
                        <EditIcon fontSize="small" />
                      </IconButton>
                    </Tooltip>
                    <Tooltip title="Delete">
                      <IconButton size="small" onClick={() => handleDelete(entry.id)}>
                        <DeleteIcon fontSize="small" />
                      </IconButton>
                    </Tooltip>
                  </Box>
                </Box>
                <Typography variant="body1">{entry.content}</Typography>
                {entry.metadata && (
                  <Typography variant="caption" color="textSecondary" sx={{ mt: 1, display: 'block' }}>
                    From: {entry.metadata.modelName || 'Unknown Model'}
                  </Typography>
                )}
              </NotebookEntry>
            ))
          )}
        </NotebookContent>
      </StyledDrawer>
    </>
  );
}

export default Notebook;
